"""
1. Отсортируйте по убыванию методом "пузырька" одномерный целочисленный массив,
заданный случайными числами на промежутке [-100; 100). Выведите на экран
исходный и отсортированный массивы. Сортировка должна быть реализована в
виде функции. Обязательно доработайте алгоритм (сделайте его умнее).

Идея доработки: если за проход по списку не совершается ни одной сортировки,
то завершение
Обязательно сделайте замеры времени обеих реализаций
и обосновать дала ли оптимизация эффективность

Подсказка: обратите внимание, сортируем не по возрастанию, как в примере,
а по убыванию
"""

from timeit import timeit
from random import randint


def bubble_sort_invert(lst_obj):
    n = 1
    while n < len(lst_obj):
        for i in range(len(lst_obj) - n):
            if lst_obj[i] < lst_obj[i + 1]:
                lst_obj[i], lst_obj[i + 1] = lst_obj[i + 1], lst_obj[i]
        n += 1
    print(lst_obj)
    return


def bubble_sort_invert_2(lst_obj):
    n = 1
    while n < len(lst_obj):
        flag = 0
        for i in range(len(lst_obj) - n):
            if lst_obj[i] < lst_obj[i + 1]:
                lst_obj[i], lst_obj[i + 1] = lst_obj[i + 1], lst_obj[i]
                flag = 1
        n += 1
        if flag == 1:
            print(lst_obj)
            return
    print(lst_obj)
    return


print('Неотсортированный список из 10 элементов')
my_list = [randint(-100, 100) for _ in range(10)]
print(my_list)

print('Отсортированный список из 10 элементов')
print(timeit("bubble_sort_invert(my_list)",
             setup="from __main__ import bubble_sort_invert, my_list", number=1))
print('Отсортированный список из 10 элементов, модиф.функция')
print(timeit("bubble_sort_invert_2(my_list)",
             setup="from __main__ import bubble_sort_invert_2, my_list", number=1))

